import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Navigate to a category page where price filter is available
    await page.waitForSelector('a:has-text("Electronics")', { timeout: 5000 });
    await page.click('a:has-text("Electronics")');

    // Wait for page to load and take screenshot
    await page.waitForLoadState('networkidle');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_category_selected.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_category_selected.png'));

    // Wait for price filter to be available and fill in values
    await page.waitForSelector('#minPrice', { timeout: 5000 });
    await page.fill('#minPrice', '100');
    await page.fill('#maxPrice', '500');

    // Take screenshot before applying filter
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_price_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_price_filled.png'));

    // Apply the price filter
    await page.click('.apply-filter');

    // Wait for results to update
    await page.waitForTimeout(1000);

    // Take screenshot after applying filter
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_filter_applied.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_filter_applied.png'));

    // Extract product information to verify filter was applied
    const productData = await page.$$eval('.product-card', products => 
      products.map(product => {
        const priceText = product.querySelector('.product-price').textContent;
        const price = parseFloat(priceText.replace('$', '').split(' ')[0]);
        return {
          title: product.querySelector('.product-title').textContent.trim(),
          price: price
        };
      })
    );

    return {
      success: true,
      action: "Applied price range filter of $100 to $500 on Electronics category",
      extractedData: {
        products: productData,
        filteredCount: productData.length
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to apply price range filter",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
